" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 532px\">",
"   <div class=\"ttl\">",
"    Shoulder external rotation against resistance",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 512px; height: 211px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Anchor tubing&nbsp;to a fixed object&nbsp;(eg, a door knob, banister, or column), stand perpendicular to the wall holding the tubing in your outside hand. Make&nbsp;sure to keep your elbow bent to 90 degrees when performing the exercise. Pinch a towel or something small between your arm and ribs to be sure your arm stays against your side. Start with your arm across your&nbsp;abdomen, then slowly rotate your arm away from your body over two seconds&nbsp;until&nbsp;it is&nbsp;about 90 degrees from your body,&nbsp;then slowly return to starting position&nbsp;over four seconds. Repeat the movement 15 times to complete one set. Do 3 sets of 15 repetitions.",
