"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Arteriovenous malformations in the brain (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/arteriovenous-malformations-in-the-brain-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H20174237\">",
"      <span class=\"h1\">",
"       What are arteriovenous malformations?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Arteriovenous malformations, called &ldquo;AVMs&rdquo; for short, are clumps of abnormal blood vessels. People can have AVMs in different places in their body. This article discusses AVMs in the brain.",
"     </p>",
"     <p>",
"      AVMs in the brain usually form before a person is born. They are rare, but they can cause serious symptoms or problems. These can happen if an AVM pushes on the brain or keeps part of the brain from getting enough oxygen. An AVM can also sometimes tear open and bleed into the brain. This happens because the blood vessels in an AVM are not as strong as normal blood vessels. A severe bleed in the brain can cause brain injury and death.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H20174252\">",
"      <span class=\"h1\">",
"       What are the symptoms of an AVM?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many AVMs do not cause any symptoms. People find out they have an AVM when their doctor does a test for another reason.",
"     </p>",
"     <p>",
"      When AVMs do cause symptoms, they can cause:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Headaches",
"       </li>",
"       <li>",
"        Seizures &ndash; Seizures are waves of abnormal electrical activity in the brain. They can make you pass out, or move or behave strangely.",
"       </li>",
"       <li>",
"        Symptoms of a stroke &ndash; A stroke is when part of the brain is injured because it goes without blood for too long or because of bleeding in part of the brain. A stroke can cause:",
"       </li>",
"       <li>",
"        A person&rsquo;s face to look uneven or droop to 1 side",
"       </li>",
"       <li>",
"        Weakness or numbness in 1 or both arms &ndash; For example, 1 arm might drift down if a person tries to hold both arms out.",
"       </li>",
"       <li>",
"        Trouble speaking, or speech that sounds strange",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H20174267\">",
"      <span class=\"h1\">",
"       Should I call the doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you have a seizure or severe headache, call your doctor or nurse right away.",
"     </p>",
"     <p>",
"      If you have symptoms of a stroke, call 9-1-1 for an ambulance.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H20174282\">",
"      <span class=\"h1\">",
"       Is there a test for an AVM?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor or nurse can do different tests to check for an AVM. Tests can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A CT or MRI scan of the brain &ndash; These are imaging tests that create pictures of the inside of the brain.",
"       </li>",
"       <li>",
"        Cerebral angiography &ndash; This test shows how blood flows through the blood vessels in the brain. For this test, the doctor will put a thin tube into a large blood vessel in your body, usually one in your leg. Then the doctor will advance the tube up into your neck. When the tube is in place, he or she will inject a dye into the tube and take X-rays. The dye will show up on the X-rays.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H20174297\">",
"      <span class=\"h1\">",
"       How is an AVM treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on different factors, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Whether your AVM is bleeding or not",
"       </li>",
"       <li>",
"        How big your AVM is and where it is in your brain",
"       </li>",
"       <li>",
"        Your symptoms",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      AVMs that are bleeding or causing symptoms usually need treatment. The different treatments for an AVM include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Surgery to remove the AVM",
"       </li>",
"       <li>",
"        Radiosurgery &ndash; This is not surgery. It involves getting radiation (high doses of X-rays) in the area of the AVM. Over time, the radiation makes the AVM less likely to bleed. This treatment usually takes a few years to work.",
"       </li>",
"       <li>",
"        Embolization &ndash; This is a procedure done during cerebral angiography. The doctor puts a material into the blood vessel that brings blood to the AVM. The material blocks off the blood vessel. Sometimes this procedure works on its own. Other times, doctors do surgery or radiosurgery after it.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your AVM is causing seizures, your doctor will treat your seizures with anti-seizure medicines. These medicines can help prevent you from having more seizures.",
"     </p>",
"     <p>",
"      If your AVM is not bleeding or causing symptoms, your doctor will talk with you about whether it needs to be treated. Not all AVMs need to be treated, especially if they are not bleeding or causing symptoms.",
"     </p>",
"     <p>",
"      There are benefits and downsides to treating AVMs that are not bleeding or causing symptoms. The main benefit is that treatment can prevent a future bleed in the brain. The main downside is that the treatments can cause problems of their own. For example, surgery can cause a seizure, stroke, or brain swelling or bleeding.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H20174312\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have an AVM and want to get pregnant, talk with your doctor. He or she might recommend treating your AVM before you try to get pregnant.",
"     </p>",
